DROP TABLE IF EXISTS Comments;
DROP TABLE IF EXISTS Goals;
DROP TABLE IF EXISTS Employees;

CREATE TABLE Employees(EmpID INT, ManagedBy INT, Password  VARCHAR(64), Firstname VARCHAR(64), Lastname VARCHAR(64), Email VARCHAR(64), CompanyID INT, CompanyName VARCHAR(64), StartDate DATE, Position VARCHAR(64), PRIMARY KEY(EmpID));
CREATE TABLE Goals(GoalID INT, EmpID INT, StartDate DATE, EndDate DATE, Description VARCHAR(64), GoalType VARCHAR(64), Status VARCHAR(64), PRIMARY KEY(GoalId), FOREIGN KEY(EmpID) REFERENCES Employees(EmpID));
CREATE TABLE Comments(CommentID INT, GoalID INT, EmpID INT, PRIMARY KEY(CommentID), FOREIGN KEY(EmpID) REFERENCES Employees(EmpID), FOREIGN KEY(GoalID) REFERENCES Goals(GoalID));

